import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import { BrowserRouter as Router } from "react-router-dom";
import App from './App';




ReactDOM.render(
  <Router>
  <React.StrictMode>
      <App />
    </React.StrictMode>,
  document.getElementById('root')
  </Router>
);
